import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();

    this.state = {
      techbros: [
        {
          name: 'Daniel'
        },
        {
          name: 'Sahee'
        },
         {
          name: 'Emmanuel'
         }
      ]
    };
  }

  render() {
    return (
      <div className='App'>
        {
          this.state.techbros.map(techbro => (
            <h1>{techbro.name}</h1>
          ))
        }

      </div>
    );
  }
}
export default App;
